import React from 'react'
import './Form.css'
import img from '../Images/contact2.jpg'

const Form = () => {
  return (
    <div>
      <div class="modal-box" >
<img class="banner-img-suggest"  src={img} ></img> 

          <div class='modal-div'>

       <p class='suggest-subheader'>Sound Data Form</p>
       
       <div style={{margin:'6vh 4vh'}}>
       <p class='input-header' id="doctorName">Doctor' s Name</p>
         <input class='input-box' style={{'width':'100%','borderRadius': 'none'}} type="text" placeholder='Dr. John'></input>


    
       </div>
       <div style={{margin:'6vh 4vh'}}>
       <p class='input-header' id="patientName">Patient' s Name</p>
         <input class='input-box' style={{'width':'100%'}}  type="text" placeholder='9152345677'></input>

       </div>
       <div class='input-suggest-flexbox'>
       <div style={{margin:'0vh 4vh'}}>
       <p class='input-header' id="age">Patient' s Age</p>
         <input class='input-box' style={{'width':'100%'}} type="text" placeholder='john@gmail.com'></input>

       </div>

       <div style={{margin:'0vh 4vh'}}>
       <p class='input-header' id="date">Date</p>
         <input class='input-box' style={{'width':'100%'}}  type="text" placeholder='Hey'></input>

       </div>
       </div>
       <div style={{margin:'8vh 4vh'}}>


        <label for='audio' className='input-header'>Audio File</label>
       <input type="file" id="audio" name="audio" accept=".mp3,audio/*" />
       </div>
       

      
       <button class='suggest-btn' id="send_button">Submit</button>
     </div>
     </div>
    </div>
  )
}

export default Form



